import './App.css';
import { Link } from 'react-router';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <ul>
        <li><Link to='/page1'>HELLO WORLD</Link></li>
        <p className="practice">YO YO YO</p>
        </ul>
      </header>
    </div>
  );
}

export default App;
